'26L' Locatiecode, zijnde een code die een locatie of geografisch gebied identificeert, of een geassocieerde groep van dergelijke locaties of gebieden, die relevantie heeft voor een gerelateerde transactie en die voldoet aan een van de structuren gedefinieerd in (a) tot (f) hieronder:
a) twee hoofdletters alfabetische tekens overeenkomend met de ISO 3166-1 twee alfa landcode van het land waarin, of bestaande uit, de locatie(s) of gebied(en) zich bevinden;
b) drie hoofdletters alfabetische tekens overeenkomend met de IATA-code van de luchthaven of stad in, dichtbij, of bestaande uit, de locatie(s) of gebied(en);
c) vier of meer tekens waarvan de eerste drie overeenkomen met een ISO 3166-1 landcode gevolgd door een streepje (-), met de rest zijnde een postcode in het betreffende land;
d) vier of meer tekens waarvan de eerste drie overeenkomen met een ISO 3166-1 landcode gevolgd door een punt (.), met de rest zijnde een ISO 3166-2 landsdeelcode in het betreffende land;
e) vijf hoofdletters alfabetische tekens overeenkomend met de UN/LOCODE van het gebied in, dichtbij, of bestaande uit, de locatie(s) of gebied(en);
f) de aaneenschakeling, zijnde niet minder dan zeven noch meer dan 35 tekens in lengte, van:
- een ISO/IEC 15459 uitgevende instantiecode;
- een locatiecode, bestaande uit tekens getrokken uit de set {A-Z; 0-9} die voldoet aan de specificaties van de betreffende uitgevende instantie.

