 - een ISO/IEC 15459 uitgevende instantiecode;
 - een apparatuurnummer dat voldoet aan de specificaties van de betreffende uitgevende instantie; en dat:
 - uitsluitend bestaat uit hoofdletters alfabetische en/of numerieke tekens;
 - uniek is (dat wil zeggen, verschilt van elke andere ISO/IEC 15459 conforme identificator) binnen het domein van de uitgevende instantie;
 - niet kan worden afgeleid van een andere ISO/IEC 15459 conforme identificator, uitgegeven onder dezelfde uitgevende instantie, door eenvoudigweg tekens toe te voegen aan, of te verwijderen uit, het einde ervan.
