Apparatuur identificator, zijnde een wereldwijd unieke identificator voor een apparaat, een item van apparatuur of instantie van een computerapplicatie gebruikt in de productie, transport, verwerking of andere afhandeling van items.

UPU Locatiecode, zijnde een code die een locatie of geografisch gebied identificeert, of een bijbehorende groep van dergelijke locaties of gebieden, die relevant is voor een gerelateerde transactie en die voldoet aan een van de structuren gedefinieerd in a) tot g) hieronder:
a) twee hoofdletters corresponderend met de ISO 3166-1 twee alfabetische landcode van het land waarin, of bestaande uit welke, de locatie(s) of gebied(en) zich bevinden;
b) drie hoofdletters corresponderend met de IATA-code van de luchthaven of stad in, dicht bij, of bestaande uit welke de locatie(s) of gebied(en) zich bevinden;
c) vier of meer karakters waarvan de eerste drie overeenkomen met een ISO 3166-1 landcode gevolgd door een streepje (-), met het saldo zijnde een postcode in het betreffende land;
d) vier of meer karakters waarvan de eerste drie overeenkomen met een ISO 3166-1 landcode gevolgd door een punt (.), met het saldo zijnde een ISO 3166-2 landsdeelcode in het betreffende land;
e) vijf hoofdletters corresponderend met de UN/LOCODE van het gebied in, dicht bij, of bestaande uit welke, de locatie(s) of gebied(en) zich bevinden;
f) zes hoofdletter alfanumerieke karakters corresponderend met een UPU IMPC-code toegewezen in overeenstemming met UPU standaard S34;
g) de concatenatie, zijnde niet minder dan zeven noch meer dan 25 karakters in lengte, van:
 - een uitgever code toegewezen in overeenstemming met UPU standaarden S31;
 - een locatiecode, bestaande uit karakters getrokken uit de set {A-Z; 0-9} die overeenkomt met de specificaties van de uitgever in kwestie.

Kentekenplaat met Servicedata en Locatiecode is een samengestelde gegevensconstructie, in overeenstemming met de specificatie in UPU standaard S25, die specificatie omvat van:
 - een ISO/IEC 15459-conforme itemidentificator;
 - een data-identificator 5U conforme specificatie van de te verlenen dienst met betrekking tot het item;
 - een data-identificator 17U conforme UPU locatiecode of een data-identificator 18U conforme gekwalificeerde UPU locatiecode.
 Let op - Voor verdere details, raadpleeg UPU standaard S25. Het onderscheid tussen een eenvoudige UPU locatiecode (DI 17U) en een gekwalificeerde UPU locatiecode (DI 18U) kan worden bepaald uit het eerste karakter. Als dit numeriek is, is 18U van toepassing; als het alfabetisch is, geldt 17U.

