Datum, weergegeven in aangepaste UTC conforme vorm:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] waar vierkante haakjes optioneel aangeven en yyyy het jaar is, mmdd de maand en dag, hhmmss de tijd van de dag in uren minuten en seconden, fff de fracties van seconden en poooo de afwijking van UTC uitgedrukt in uren en minuten, de afwijking zijnde positief als p een punt (.) is, negatief als P een minteken (-) is.
VOORBEELD:
2005 - (UTC) kalenderjaar 2005;
200505 - (UTC) kalendermaand mei 2005;
20050518 - (UTC) 18 mei 2005;
200505181247 - 12:47 UTC op 18 mei 2005;
200505181247.0100 - 12:47 lokale tijd, zijnde 11:47 UTC, op 18 mei 2005;
20050518124723099 - 99 milliseconden na UTC 12:47:23 op 18 mei 200.

Gekwalificeerde Datum, bestaande uit de aaneenschakeling van:
- een ISO/IEC 15459 uitgevende instantiecode;
- een datumkwalificatie conform de specificaties van die uitgevende instantie;
- een datum waarvan het formaat en de interpretatie overeenkomen met de specificaties van de uitgevende instantie voor die datumkwalificatie.

Verklaring van Verpakkingsmateriaal Categorie*, Code* en Gewicht voor een gegeven verpakkingsmateriaal gebruikt in een gegeven verpakking volgens de EU-richtlijn voor verpakkingen en verpakkingsafval. (Materiaalcategorie en code gedefinieerd in Bijlage M).
12ECCMMMMMMNNNNNUU waar: - '12E' (an3) is de Data Identifier;
 - 'CC' (n2) is de Materiaalcategorie per Bijlage M;
 - 'MMMMMM' (an1...6) is de Materiaalcode per Bijlage M;
 - 'NNNNN' (n5) Materiaalgewicht, inclusief decimaalpunt (bijv., 12.12);
 - 'UU' (an2) is de Eenheid van maat voor gewicht (bijv., KG, GR, LB of OZ per ANSI X12.3 zoals in Bijlage D).

