Ontvangersnummer.
Het unieke identificatienummer kan het IRS, EIN, SSN of het door CBP toegewezen nummer zijn, zoals vereist op de Security Filing. Alleen de volgende formaten mogen worden gebruikt: IRS EIN: NN-NNNNNNN;
IRS EIN met achtervoegsel:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP toegewezen nr: YYDDPP-NNNNN.
